import React, { useState } from "react";
import FileUploadStep from "./FileUploadStep";

const RegistrationForm = () => {
  const [step, setStep] = useState(4); // Set step 4 for testing
  const [errors, setErrors] = useState({});
  const [formData, setFormData] = useState({
    files: {
      rctResolution: { file: null },
      dti: { file: null, dateOfIssuance: "", dateOfValidity: "" },
      sec: { file: null, registryNo: "", dateOfIssuance: "", dateOfValidity: "" },
      businessPermit: { file: null, registryNo: "", dateOfIssuance: "", dateOfValidity: "" },
    },
  });

  return (
    <form>
      {step === 4 && <FileUploadStep formData={formData} setFormData={setFormData} errors={errors} />}
    </form>
  );
};

export default RegistrationForm;
